import React from 'react';

const Logo = () => {
    return (
        <div>
            <h1>
                <span>F</span><span></span>
                <span>Z</span><span></span>
                <span>L</span><span></span>
                <span>P</span><span></span>
            </h1>          
        </div>
    );
}

export default Logo;
